EXPRESSION:
CASE
  WHEN COALESCE(FES_EVENT_1_0.ACTIVATE_DATE, '') = '' THEN '1000-01-03 00:00:00.000'
  ELSE (
    CAST(
      CAST(
        SUBSTR(FES_EVENT_1_0.ACTIVATE_DATE, 1, 4) || '-' || SUBSTR(FES_EVENT_1_0.ACTIVATE_DATE, 6, 2) || '-' || SUBSTR(FES_EVENT_1_0.ACTIVATE_DATE, 9, 2) || ' ' || SUBSTR(FES_EVENT_1_0.ACTIVATE_DATE, 12, 2) || ':' || SUBSTR(FES_EVENT_1_0.ACTIVATE_DATE, 15, 2) || ':' || SUBSTR(FES_EVENT_1_0.ACTIVATE_DATE, 18, 2) || '.' || SUBSTR(FES_EVENT_1_0.ACTIVATE_DATE, 21, 3) AS TIMESTAMP
      ) AS VARCHAR(26)
    )
  )
END

